import React, { Component } from 'react';
import { Segment, Header, Checkbox } from "semantic-ui-react";

class TodoArea extends Component {

    render(){
        const { recieveData, currentData } = this.props;
        return (
            <Segment
                style={{
                    height: "100%",
                    marginTop: "0px",
                    marginLeft: "1em",
                    minWidth: "350px",
                    boxSizing: "border-box",
                }}
            >
                <Header as="h4">Todo for demo:</Header>
                <Checkbox label="No data area" />
                <br />
                <Checkbox label="target input" />
                <br />
                <Checkbox label="go to plane button" />
            </Segment>
        );
    }
}

export default TodoArea;
